import React from 'react';

class LogInPage extends React.Component {
  render() {
    return (
      <div>
        <label>
            Email:
            <input
              name="email"
              type="text"
              maxLength="50"
            />
          </label>
          <label>
            Senha:
            <input
              name="senha"
              type="number"
              maxLength="50"
            />
          </label>
      </div>
    )
  }
}

export default LogInPage;
